import { createSlice } from '@reduxjs/toolkit';

const moviesSlice = createSlice({
  name: 'movies',
  initialstate: [],
  reducers: {
    addMovies(state, action) {},
  },
});

export const { addMovies } = moviesSlice.actions;
export const moviesReducer = moviesSlice.reducer;
